INSERT INTO `comentarios` (`idComm`, `nombrePala`, `comentario`) VALUES
(2, 'Bull Padel Vertex', 'La Vertex 03 es una pala con forma de diamante, de máxima potencia, alto rendimiento sin pérdidas de control.\r\n\r\nSin lugar a dudas sí es una pala con muy buena potencia.\r\nEs una pala con buen control, pero siempre comparada con otras palas en forma de diamante)\r\nBuena zona de punto dulce\r\nComo gran novedad, destaca la incorporación del nuevo corazón Vertex con el sistema Air React Channel, donde la estructura hueca aumenta la estabilidad del marco por lo que se obtiene mayor reacción en la salida de la bola y una mayor precisión en el golpeo.\r\n\r\nCreo que este sistema es una de la aportación a mejorar la zona de punto dulce y firmeza en el golpe (lo que da ese sensación de buen control)'),
(3, 'Shooter Merak', 'La SHOOTER PADEL MERAK, después de probarla intensamente, la podemos definir como una pala de control muy cómoda y equilibrada, que permite un gran nivel de control manteniendo una potencia endiablada.\r\n\r\nComo toda la gama de palas SHOOTER PADEL, la nueva MERAK está fabricada con componentes propios de palas profesionales del más alto nivel como el marco tubular 100% carbono 3K para evitar roturas y refuerzos en Basalto en el puente de la pala.\r\n\r\nEl núcleo de la MERAK está fabricado en Low Density FOAM de alta absorción de vibraciones y el acabado de su superficie de impacto incorpora el acabado Hyper Roughness Surface pero en este caso, con un atractivo acabado final mate, que refuerza la original imagen de esta pala.'),
(4, 'Vibora Yarara', 'Review Vibora Yarara Edition 2019|Blog T2P\r\n22 Abr Review Vibora Yarara Edition 2019\r\nPosted at 10:48h in Blog de pádel by Time2Padel 0 Comments Share\r\nLa firma española Vibora vuelve y lo hace con más fuerza que nunca. Este 2019 la colección de palas de pádel Vibora 2019 es ya una realidad y llega al mercado con algunos de sus modelos más emblemáticos como la Vibora Yarara Edition, Vibora Black Mamba y muchas más.\r\n\r\nUna propuesta de la firma nacional que, como es característico desde sus orígenes, está basada en prestaciones de alta gama, diseños que dan la mano a la vistosidad y la elegancia y unas sensaciones de confort óptima para todos los perfiles de jugadores existentes.\r\n\r\nY este 2019 la nueva colección de palas de pádel Vibora llega con más fuerza que nunca pues se reinventa para lucir más moderna, más completa y más atractiva que nunca.'),
(5, 'Kombat Aquiles', 'Kombat resulta una marca que siempre está bajo observación. Su atrevida apuesta de palas de gama alta a precios por debajo del os 100€ es un potente atractivo. Esto es posible debido a la eliminación de intermediarios, redes de distribución y de sobrecostes. Y de ajustar los márgenes de beneficios. Sin embargo, el precio inicial de 95€, en 2022 se ha convertido en 99€. Un aumento apenas significativo para el bolsillo del usuario/a, pero… Con la subida del precio de las materias primas, de la gasolina y del transporte, ¿podrán mantener estos precios?');

