INSERT INTO `pala` (`idPala`, `nombre`, `palaCol`, `precio`, `peso`, `photo`, `descripcion`, `idMarca`, `idTipo`) VALUES
(1, 'Pala Stealth', 'Negro y verde', 220, 365, , 'Los jugadores de pádel que quieren incrementar el efecto de la bola en sus golpes cortados y liftados descubrirán lo que es jugar a otro nivel con la pala de pádel SHOOTER PADEL STEALTH. Una pala de pádel bien balanceada y de gran potencia. \r\n\r\nLa superficie de esta pala de pádel profesional SHOOTER PADEL STEALTH es de carbono 3K y fibra de vidrio y cuenta con un marco tubular de carbono 100% 3K y basalto. Su forma MIX-OVERSIZE exclusiva de SHOOTER PADEL será especialmente apreciada por aquellos jugadores que busquen un gran nivel de control y la mayor potencia.\r\n\r\nAdemás la tecnología MICRO ROUGHNESS, con un acabado de rugosidad media, aportará grandes efectos y control en los golpes liftados y cortados. La STEALTH tiene además un punto dulce centrado y muy amplio. Descubre la gama SHOOTER PADEL STEALTH y elige la versión que más te guste entre sus colores verde lima o azul-fucsia.\r\n\r\nLa SHOOTER PADEL es de fabricación 100% nacional y está diseñada con una tecnología especial anti-vibración para evitar lesiones. El proceso de fabricación permite también la personalización de cada pala con el nombre del jugador*, para que no encuentres otra pala igual en la pista.', 'SHOO', 113);
INSERT INTO `pala` (`idPala`, `nombre`, `palaCol`, `precio`, `peso`, `photo`, `descripcion`, `idMarca`, `idTipo`) VALUES
(2, 'Pala Merak', 'Gris y naranja', 165, 350, , 'La pala de pádel SHOOTER PADEL MERAK ofrece una gran potencia sin renunciar a un alto control de la bola a jugadores de iniciación o de nivel medio. Es una pala de control bien balanceada que además ofrece buena potencia.\r\n\r\nSu núcleo de LD Foam de Baja Densidad combinada con la Low Vibration Technology hace que la pala MERAK tenga una absorción de vibraciones excelente, una de las más efectivas de la gama SHOOTER.\r\n\r\nLa superficie de esta pala de pádel está fabricada con doble fibra de vidrio y cuenta con un marco tubular 100% Carbono 3K con basalto en la zona del puente para mayor resistencia y reducción de vibraciones (Hybrid Carbon Frame Technology). Su forma MIX-OVERSIZE exclusiva de SHOOTER PADEL hará las delicias de aquellos jugadores profesionales que busquen el mayor control y la mayor potencia.\r\n\r\nAdemás la tecnología HYPER ROUGHNESS, con un acabado de rugosidad alta, aporta un gran efecto en los golpes liftados y una alta salida de bola. ', 'SHOO', 112);
INSERT INTO `pala` (`idPala`, `nombre`, `palaCol`, `precio`, `peso`, `photo`, `descripcion`, `idMarca`, `idTipo`) VALUES
(3, 'Pala Flow', 'Gris y azul', 150, 355, , 'La nueva pala de padel para mujer Flow de Bullpadel es una pala ligera de forma híbrida y esto consigue un perfecto equilibrio entre potencia y control. Está concebida para jugadoras profesionales o avanzadas.\r\nSu núcleo externo se compone de fibra híbrida Fibrix y un acabado rugoso 3D grain en forma de estrella para imprimir mayor efecto a los golpes. Su núcleo interno está compuesto por la nueva MultiEva que consta de 2 densidades de eva diferentes y su marco CarbonTube de fibra de carbono 100%.\r\n\r\nIncorpora el protector Sticker, este protector adhesivo es ligero, flexible y resistente.', 'BULL', 112);
INSERT INTO `pala` (`idPala`, `nombre`, `palaCol`, `precio`, `peso`, `photo`, `descripcion`, `idMarca`, `idTipo`) VALUES
(4, 'Pala Yarara Liq', 'Negro y Dorado', 190, 368, , 'La Yarara Edition es una de las mejores palas del mercado, gracias a que equilibra el golpeo con control y potencia extraordinaria.\r\n\r\n- Presenta una amplia superficie de golpeo, fabricada con materiales muy resistentes y elásticos y con tacto blando.\r\n- Esta pala está diseñada para jugadores avanzados-profesionales que buscan la combinación perfecta entre excelente control y gran potencia para un juego polivalente.\r\n- Fabricada con forma de lágrima, con perfil de 38 mm. y un peso que va de los 355 a los 375 gramos.\r\n- Superficie con ligero relieve para mayor efecto en el golpeo de la bola.\r\n- Con núcleo de EVA blanda, con un marco dbole tubular de Kevlar y cara de Carbon+ le brinda una gran durabilidad.\r\n- Integra la tecnología Liquid que permite que la pala se adapte a cada tipo de jugador para mayor rendimiento bajo cualquier situación durante el juego.\r\n- Diseño elegante e impactante, que combina como base el color negro con detalles en dorado y rojo.', 'VIB', 111);
INSERT INTO `pala` (`idPala`, `nombre`, `palaCol`, `precio`, `peso`, `photo`, `descripcion`, `idMarca`, `idTipo`) VALUES
(5, 'Pala Hack', 'Negra', 260, 360, , 'Está concebida para jugadores profesionales o avanzados. Su núcleo externo se compone de fibra híbrida Fibrix, su núcleo interno está compuesto por la nueva MultiEva que consta de 2 densidades de eva diferentes y su marco CarbonTube de fibra de carbono100%. Cuenta además, con el protector de aluminio Metalshield, corazón Hack y canales Nerve en el lateral del marco de la pala.', 'BULL', 111);
INSERT INTO `pala` (`idPala`, `nombre`, `palaCol`, `precio`, `peso`, `photo`, `descripcion`, `idMarca`, `idTipo`) VALUES
(6, 'Pala Black Mamb', 'Negra y Roja', 300, 375, , 'Una de las características más reseñables de esta pala es su goma EVA Soft que es la que le confiere ese tacto agradable y un sonido en el golpeo que hacen las delicias de los paddeleros más \"pros\". Y es que esta Vibor-A Black Mamba está claramente destinada al sector más especialista y profesional del pádel. Es decir, que si acabas de empezar en este apasionante mundillo este no es tu modelo de pala de pádel. Pero si ya juegas 2/3 veces a la semana y tienes el pádel en la sangre, no lo dudes, y busca en nuestro comparador el mejor precio.', 'VIB', 111);
INSERT INTO `pala` (`idPala`, `nombre`, `palaCol`, `precio`, `peso`, `photo`, `descripcion`, `idMarca`, `idTipo`) VALUES
(7, 'Pala Hack Hard', 'Negra', 350, 370, , 'Su núcleo externo se compone del nuevo carbono combinado Tricarbon, su núcleo interno de la nueva goma MultiEva y su marco CarbonTube de fibra de carbono 100%.\r\n\r\n\r\nLa nueva pala Hack 03 22 cuenta con el nuevo marco Metalshield que se adapta al novedoso sistema de placas de peso CustomWeight que permite modificar el balance de la pala en función de las necesidades de cada jugador.', 'BULL', 111);
INSERT INTO `pala` (`idPala`, `nombre`, `palaCol`, `precio`, `peso`, `photo`, `descripcion`, `idMarca`, `idTipo`) VALUES
(8, 'Pala Yarara Ext', 'Negra y Rojo', 290, 360, , 'Fabricada en un formato lágrima Oversize ofrece un balance medio y cuenta con un perfil de 38 mm. En cuanto al marco Double Full Tube de carbono+ se encarga de proporcionar mayor resistencia a los golpes y en combinación con los planos de fibra de vidrio y Klevar garantizan mayor potencia durante los golpeos. El núcleo de goma Eva Core, de tacto blando aporta confort y flexibilidad para conseguir golpes más precisos. Con un perfil de 38 mm y un balance medio.', 'VIB', 111);
INSERT INTO `pala` (`idPala`, `nombre`, `palaCol`, `precio`, `peso`, `photo`, `descripcion`, `idMarca`, `idTipo`) VALUES
(9, 'Pala Troya Aqui', 'Negra y Gris', 99, 365, , '¡¡Troya llega a Kombat!! Tres moldes diferentes con un mismo corazón, el corazón del KOMBATiente: Aquiles en diamante, Ulises en lágrima y Ajax de forma redonda.\r\n\r\nLa Kombat Troya Aquiles es una pala profesional pensada para grandes guerreros que buscan la máxima potencia en pista. De formato diamante y balance alto, a esta pala la hemos dotado con carbono 12K y ¡unos planos rugosos acabados en lija!\r\n\r\n¿Su diseño? ¡Simplemente ESPECTACULAR! Sus azules tan característicos y sus detalles en color bronce hacen que esta arma sea una pala grandiosa.', 'KOM', 112);
INSERT INTO `pala` (`idPala`, `nombre`, `palaCol`, `precio`, `peso`, `photo`, `descripcion`, `idMarca`, `idTipo`) VALUES
(10, 'Pala Troya Ulis', 'Azul', 99, 355, , '¡¡Troya llega a Kombat!! Tres moldes diferentes con un mismo corazón, el corazón del KOMBATiente: Aquiles en diamante, Ulises en lágrima y Ajax de forma redonda.\r\n\r\nLa Kombat Troya Ulises está inspirada en este personaje de la mitología griega, ya que comparte las características de este héroe: brillantez, astucia y versatilidad en su carácter.\r\n\r\nEsta pala de formato lágrima la hemos creado con unos planos de carbono 12K acabados el lija para que tus golpes tengan el efecto definitivo en la batalla.Cuenta con un nuevo diseño sorprendente y espectacular en azules y bronce que te enamorará en cuanto la tengas en tus manos.', 'KOM', 113);
INSERT INTO `pala` (`idPala`, `nombre`, `palaCol`, `precio`, `peso`, `photo`, `descripcion`, `idMarca`, `idTipo`) VALUES
(12, 'Pala Troya 18K', 'Blanca', 99, 355, , 'Llega a Kombat la lujuria hecha pala: ¡El arma definitiva!.\r\n\r\nLa nueva Kombat Black Edition 18K es una pala de gama alta con formato diamante que se convertirá en tu mejor aliada para el Kombate.\r\n\r\nEsta nueva edición viene con un diseño renovado más espectacular que nunca y carbono 18k con planos rugosos en acabado lija. Todas estas características la convierten en una ¡¡pala imponente!!\r\n\r\nEn definitiva, la Kombat Black Edition es la pala de pádel profesional para todos, ¡es puro espectáculo!', 'KOM', 113);

